    null,nt"notes": "This data set shows the location of Baltimore City's Public
    Aquatic "Pools" Facilities. It is the most recent update (2008), and is subjected
    to change. The purpose of this data set is to aid Baltimore City organizations to
    best identify public aquatic recreational facilities. The data is broken down into
    categories: Wading, Walk-to, and Park Pools. Please find the definitions below:
    Wading Pools: are aquatic facilites that are no more than 24 inches in dept. These
    facilities are not chlorinated and has a turn over rate of approximately two hours.
    Walk-to Pools: are Aquatic facilities that are located within a neighborhood and
    not in a public park. These facilities are approximately 5ft in dept. Park Pools:
    are aquatic facilities that are located within the City's public parks. These facilities
    are more than 5ft in dept. The data set was provided by Daryl Sutton, Director of
    Recreation and Parks Aquatic Department.",nt"license_title": "Other License
